import React from "react";
import { Container, Row, Col } from "react-bootstrap";
const GlobalFooter = () => {
	return (
		<footer className="bg-body-tertiary p-0 d-flex justify-content-center">
			<Container fluid className="m-0 p-0">
				<Row
					className="d-flex justify-content-center p-1 w-100 bg-danger-subtle m-0"
					style={{ fontSize: ".6rem" }}
				>
					<p className=" m-0">Siyabonga B Soko</p>
				</Row>
			</Container>
		</footer>
	);
};

export default GlobalFooter;
